import React from "react";

const Person = () => {
  return (
    <svg
      width="18"
      height="18"
      viewBox="0 0 18 18"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <path
        d="M9.05059 9.2C11.3292 9.2 13.1764 7.36437 13.1764 5.1C13.1764 2.83563 11.3292 1 9.05059 1C6.77198 1 4.9248 2.83563 4.9248 5.1C4.9248 7.36437 6.77198 9.2 9.05059 9.2Z"
        stroke="#00A6B0"
        strokeMiterlimit="10"
        strokeLinecap="round"
      />
      <path
        d="M1 17V16.5C1 12.4 4.32076 9.19995 8.34591 9.19995H9.65409C13.7799 9.19995 17 12.5 17 16.5V17"
        stroke="#00A6B0"
        strokeMiterlimit="10"
        strokeLinecap="round"
      />
    </svg>
  );
};

export default Person;
